			"notes": "Inkluderer: Industriproduksjon omfatter fysisk eller kjemisk omdanning av materialer, stoffer eller deler til nye produkter, selv om dette ikke kan brukes som det eneste kriteriet for industriproduksjon (jf. merknaden til avfallsbehandling nedenfor), de omdannede materialene, stoffene eller deler av råmaterialer som stammer fra jordbruk, skogbruk, fiske, bergverksdrift eller fra annen industriproduksjon. Vesentlig omdanning eller renovering av produkter betraktes vanligvis som industriproduksjon. Enhetene innenfor industriproduksjon betegnes ofte som anlegg eller fabrikker og nytter typisk motordrevne maskiner og motordrevne håndverksmaskiner.\nInkluderer også: Dette hovedområdet omfatter også enheter som omdanner materialer eller stoffer til nye produkter manuelt og enheter som selger produktene fra det stedet hvor de produseres, f.eks. bakere og skreddere. Produksjonsenhetene kan: bearbeide egne materialer, kontrahere med andre enheter om bearbeiding av materialene, eie råmaterialene, men kontrahere med andre enheter om produksjonen, utføre de kontraktskrevne funksjoner som nevnt ovenfor. Produkter fra industriproduksjon kan være ferdigprodukter og dermed klare til bruk eller forbruk, eller halvfabrikata som er beregnet til viderebearbeiding. F.eks. så inngår det produktet, som framkommer ved raffinering av aluminiumoksyd, i primærproduksjon av aluminium, primæraluminium brukes til produksjon av aluminiumstråd og aluminiumstråd brukes til produksjon av trådvarer. Produksjon av spesialiserte komponenter og deler og tilbehør og hjelpemidler til maskiner og utstyr grupperes vanligvis i samme næringsgruppe som produksjon av de maskinene og utstyret som de tilhører. Produksjon av ikke-spesialiserte komponenter som f.eks. motorer, stempler, elektromotorer, elektriske komponenter, ventiler, tannhjul og kulelager, grupperes i den relevante næringsgruppe under industri, uansett hvilke maskiner eller utstyr disse skal installeres i eller på. Imidlertid er produksjon av spesialiserte komponenter og tilbehør ved støping eller pressforming av plastmaterialer gruppert i næringshovedgruppe 22.2 Produksjon av plastprodukter. Montering av deler av komponenter til ferdige produkter betraktes som produksjon. Dette omfatter montering av egenproduserte eller innkjøpte komponenter. Gjenvinning av avfall, dvs. bearbeiding av avfall til sekundære råmaterialer, grupperes i næringshovedgruppe 38.3  (Materialgjenvinning). Selv om dette kan omfatte fysisk eller kjemisk omdanning, betraktes det ikke som en del av produksjonen. Det primære formålet med disse aktivitetene anses å være behandling eller bearbeiding av avfall og de er derfor gruppert i næringshovedområde E (Vannforsyning, avløps- og renovasjonsvirksomhet). Produksjon av nye produkter (i motsetning til sekundære råmaterialer) grupperes imidlertid som industriproduksjon, selv om avfall blir brukt som råvare i slike prosesser. Produksjon av sølv fra filmavfall betraktes f.eks. som industriproduksjon. Spesialisert vedlikehold og reparasjon av industrielle, kommersielle og lignende maskiner og utstyr grupperes vanligvis i næring 33  (Reparasjon og installasjon av maskiner og utstyr). Reparasjon av datamaskiner, husholdningsvarer og varer til personlig bruk grupperes imidlertid i næring  95 (Reparasjon av datamaskiner, husholdningsvarer og varer til personlig bruk), mens reparasjon av motorvogner og motorsykler grupperes i næring  45  (Handel med og reparasjon av motorvogner). Installasjon av maskiner og utstyr grupperes i næringsgruppe 33.20 (Installasjon av industrimaskiner og -utstyr), når det blir utført som en egen aktivitet. NB! Grensegangen mellom industriproduksjon og andre sektorer i klassifiseringssystemet kan være noe uklar. Som hovedregel omfatter aktivitetene i næringshovedområde C (Industri) omdanning av materialer til nye produkter. Resultatet er et nytt produkt. Definisjonen av et nytt produkt kan imidlertid være litt subjektiv.",
